import React from "react";
import {Button, Layout} from 'antd';

import "./header.less";

const { Header } = Layout;
const size = "large";

const AppHeader = () => {
    return (
        <Header>
            <Button type="dashed" size={size}>
                Sign In
            </Button>
            <br />
            <Button type="dashed" size={size}>
                Sign Up
            </Button>
        </Header>
    )
};

export default AppHeader;
